import React, {Component} from 'react';
import logo from './assests/logo.png';
import shopping_cart from './assests/shopping_cart.jpeg';
import profile_image from './assests/avatar.png';
import './navbar.css';

class Navbar extends Component {
	state = {
		tags: ['Home','About us','Our Lands','Our Suppliers','Products', 'Contact Us']
	}
	render() {
		return (
			<div className="container">
				<nav className="navbar">
					<div>
						<img src={logo} className="icon"/>
					</div>
					<ul className="links"> {this.state.tags.map (link => <li key={link}><a className="anchor">{link}</a></li>)} </ul>
					<label htmlFor ="menu" className="menu">
						<i className="fa fa-bars bars"></i>
						<i className="fa fa-times cross"></i>
					</label>
					<div className="left-menu">
						<img src={shopping_cart} className="shopping_cart"/>
						<img src={profile_image} className="avatar"/>
					</div>
				</nav>
			</div>
		  );
	}
}
export default Navbar ;
